import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import { Home } from './Home';
import { Header } from './Header'
import { NavExample } from './NavExample'
import { Footer } from './Footer';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header/>
        <NavExample/> <Home 
       />
        <Footer />
      </header>
    </div>
  );
}

export default App;
